@Test public void testRequestResponse404() throws Throwable {
        enqueue404();

        EditClient.Callback cb = mock(EditClient.Callback.class);
        Call<Edit> call = request(cb, false);

        server().takeRequest();
        assertCallbackFailure(call, cb, HttpStatusException.class);
    }

